            4: {"title": "올해 계획, 계획했던 것보다 달성을 못할 것 같은데 이건 어떻게 조정해야할까?", "type": "JP", "A": "빠르게 판단하고 계획해 진행해야한다! 우선 행동을 멈추고 비상소집 후 회의를 진행한다.", "B": "이렇게 될 줄 예상하고 있었어. 우선 할 수 있는 것부터 실행해보고 방법을 찾아나간다."},
